def agent_action(execution_engine, member_id):
    if member_id >= len(execution_engine.current_members):
        return

    me = execution_engine.current_members[member_id]
    victim_matrix = execution_engine.relationship_dict['victim']
    attack_counts = []

    for attacker_id in range(len(execution_engine.current_members)):
        if attacker_id != member_id and attacker_id < victim_matrix.shape[0]:
            attack_counts.append((attacker_id, victim_matrix[attacker_id][me.id]))

    if attack_counts:
        # Find the attacker with the highest attack value
        attacker_id, max_attacks = max(attack_counts, key=lambda x: x[1])
        if max_attacks > 0 and attacker_id < len(execution_engine.current_members):
            execution_engine.attack(me, execution_engine.current_members[attacker_id])
            return

    # If not under attack, offer protection to the most vulnerable member
    vulnerable_members = [
        member for member in execution_engine.current_members
        if member.id != member_id and member.vitality < 50.0
    ]

    if vulnerable_members:
        # Choose the member with the lowest vitality
        target_member = min(vulnerable_members, key=lambda m: m.vitality)
        execution_engine.offer(me, target_member, True)

